    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from January through April of 1961. The report
    begins by summarizing the weather conditions, water conditions, habitat conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, and raptors- is also
    covered. The Refuge development and maintenance section discusses physical developments
    and plantings. Resource management is outlined; topics include grazing. The public
    relations section of the report describes recreational uses, Refuge visitors, and
    Refuge participation. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
